import { NavLink, Route, Switch, Redirect} from 'react-router-dom';
import React from 'react';
import classes from './NavBar.css'

function NavBar() {

    let url_path = '/'

    function onTabClick(event) {
        console.log(event.target.id)
        url_path = '/' + event.target.id
        alert(url_path)
    }
    
    return ( 
        <div className={classes.container}>

        <NavLink activeClassName={classes.active} to={url_path}>
        <button id='home' onClick={onTabClick}> <img id='home' src='favicon.ico'/> </button>
        </NavLink>

        <NavLink activeClassName={classes.active} to='/tab1'>
        <button id='1' onClick={onTabClick}>Tab 1</button>
        </NavLink>
        
        <NavLink activeClassName={classes.active} to='/tab2'>
        <button id='2' onClick={onTabClick}>Tab 2</button>
        </NavLink>
        
        <NavLink activeClassName={classes.active} to='/tab3'>
        <button id='3' onClick={onTabClick}>Tab 3</button>
        </NavLink>
        
        
        </div>
     );
}

export default NavBar;
